<script>
import { ref, computed, onMounted, onUnmounted } from 'vue'
import svgPanZoom from 'svg-pan-zoom'
import Hammer from 'hammerjs'
import PAARTNER_PARCELS from '@/data/paartnerParcels.json'

const CITAADEL_WIDTH = 9504
const CITAADEL_HEIGHT = 6336
const CITAADEL_ASPECT_RATIO = CITAADEL_WIDTH / CITAADEL_HEIGHT

export default {
  props: {
    viewBox: { type: String, default: `0 0 ${CITAADEL_WIDTH} ${CITAADEL_HEIGHT}` },
    aspectRatio: { type: Number, default: CITAADEL_ASPECT_RATIO },
    parcels: { type: Array, default: () => [] },
    parcelsMatchingFilters: { type: Object, default: () => ({}) }, /* parcel Id => boolean show */
    parcelColors: { type: Object, default: () => ({}) }, /* parcel Id => color */
    selectedParcel: { type: Object, default: null },
    mapConfig: { type: Object, default: null }
  },
  setup (props, { emit }) {
    // console.time('setup CitaadelMap')
    const colorScheme = 'light'
    const svgContainerRef = ref(null)
    const svgRef = ref(null)
    const zoomCircleRef = ref(null)

    const parcelFallbackFill = computed(() => colorScheme === 'light' ? '#eee' : '#222')

    const paartnerParcels = computed(() => {
      return PAARTNER_PARCELS.map(parcel => ({
        ...parcel,
        // logoUrl: parcel.paartner ? require(`./paartnerLogos/${parcel.paartner}.svg`) : null
      }))
    })

    // Workaround to avoid click-selections while dragging to pan
    let lastMousedown = null
    const onMouseDownParcel = function (evt) {
      lastMousedown = { x: evt.clientX, y: evt.clientY }
    }
    const onClickParcel = function (evt, parcel) {
      if (lastMousedown && evt.clientX === lastMousedown.x && evt.clientY === lastMousedown.y) {
        emit('click:parcel', parcel)
      }
    }

    let isVisible = false
    let panZoom = null
    let deferredZoomToPoint = null
    const resetZoom = function () {
      if (!panZoom) { return }
      panZoom.reset()
    }
    // Provide x and y in the original SVG coordinates
    const zoomToPoint = async function ({ x, y, zoom = 4 }) {
      if (!panZoom || !svgRef.value || !zoomCircleRef.value) { return }
      if (!isVisible) {
        deferredZoomToPoint = { x, y, zoom }
        return
      }
      // console.log('zoomToPoint', x, y, zoom)
      // Place the SVG circle at the requested point
      zoomCircleRef.value.setAttribute('cx', x)
      zoomCircleRef.value.setAttribute('cy', y)
      // Get the rendered (top-left corner) positions of the container SVG and the circle
      const svgRect = svgRef.value.getBoundingClientRect()
      const circleRect = zoomCircleRef.value.getBoundingClientRect()
      // Calculate the relative position of the circle compared to
      // the svg's top-left corner
      const top = circleRect.top - svgRect.top
      const left = circleRect.left - svgRect.left
      // console.log({ svgRect, circleRect, top, left })
      // Calculate the amount to move in each direction,
      // to put the circle in the middle of the svg rect area
      const panX = -left + (svgRect.width / 2)
      const panY = -top + (svgRect.height / 2)
      // console.log({ panX, panY })
      // First pan to put the circle in the centre, then zoom
      panZoom.panBy({ x: panX, y: panY })
      panZoom.zoom(zoom)
    }

    let resizeObserver = null

    onMounted(() => {
      // console.timeLog('mount CitaadelMap')
      // mobile example code https://bumbu.me/svg-pan-zoom/demo/mobile.html
      // limit panning example code https://bumbu.me/svg-pan-zoom/demo/limit-pan.html
      panZoom = svgPanZoom(svgRef.value, {
        dblClickZoomEnabled: false,
        // TODO this example code doesn't calculate the limits correctly at high zoom
        /*
        beforePan: function (oldPan, newPan) {
          const gutterWidth = 100
          const gutterHeight = 100
          // Computed variables
          const sizes = this.getSizes()
          const leftLimit = -((sizes.viewBox.x + sizes.viewBox.width) * sizes.realZoom) + gutterWidth
          const rightLimit = sizes.width - gutterWidth - (sizes.viewBox.x * sizes.realZoom)
          const topLimit = -((sizes.viewBox.y + sizes.viewBox.height) * sizes.realZoom) + gutterHeight
          const bottomLimit = sizes.height - gutterHeight - (sizes.viewBox.y * sizes.realZoom)

          const customPan = {
            x: Math.max(leftLimit, Math.min(rightLimit, newPan.x)),
            y: Math.max(topLimit, Math.min(bottomLimit, newPan.y))
          }
          return customPan
        },
        */
        customEventsHandler: {
          haltEventListeners: ['touchstart', 'touchend', 'touchmove', 'touchleave', 'touchcancel'],
          init: function (options) {
            const instance = options.instance
            let initialScale = 1
            let pannedX = 0
            let pannedY = 0

            // Init Hammer
            // Listen only for pointer and touch events
            this.hammer = Hammer(options.svgElement, {
              inputClass: Hammer.SUPPORT_POINTER_EVENTS ? Hammer.PointerEventInput : Hammer.TouchInput
            })

            // Enable pinch
            this.hammer.get('pinch').set({ enable: true })

            // Handle double tap
            this.hammer.on('doubletap', function () {
              instance.zoomIn()
            })

            // Handle pan
            this.hammer.on('panstart panmove', function (ev) {
              // On pan start reset panned variables
              if (ev.type === 'panstart') {
                pannedX = 0
                pannedY = 0
              }

              // Pan only the difference
              instance.panBy({ x: ev.deltaX - pannedX, y: ev.deltaY - pannedY })
              pannedX = ev.deltaX
              pannedY = ev.deltaY
            })

            // Handle pinch
            this.hammer.on('pinchstart pinchmove', function (ev) {
              // apply center calculation fix from https://github.com/bumbu/svg-pan-zoom/issues/350#issuecomment-560509636
              const el = ev.target
              const rect = el.getBoundingClientRect()
              const pos = {
                x: (ev.center.x - rect.left),
                y: (ev.center.y - rect.top)
              }
              // On pinch start remember initial zoom
              if (ev.type === 'pinchstart') {
                initialScale = instance.getZoom()
                instance.zoomAtPoint(initialScale * ev.scale, pos)
              }

              instance.zoomAtPoint(initialScale * ev.scale, pos)
            })

            // Prevent moving the page on some devices when panning over SVG
            options.svgElement.addEventListener('touchmove', function (e) { e.preventDefault() })
          },
          destroy: function () {
            this.hammer.destroy()
          }
        }
      })

      // panZoom instance needs notifying when its container size changes,
      // so that zoomToPoint still works after a resize.
      // But it breaks totally if you notify it while it's hidden (https://github.com/bumbu/svg-pan-zoom/issues/279)
      // so a simple window.resize observer is no good.
      // ResizeObserver detects both normal resize and visibility changes (0 size when hidden),
      // but it doesn't work reliably with svg elements (window resize doesn't trigger),
      // so instead watch a DIV container wrapping the SVG.
      // Delay any zoomToPoint requests until the map becomes visible again.
      resizeObserver = new ResizeObserver(entries => {
        const contentRect = entries[0]?.contentRect
        const wasVisible = isVisible
        isVisible = contentRect && (contentRect.width || contentRect.height)
        if (isVisible && panZoom) {
          panZoom.resize()
        }
        if (!wasVisible && isVisible && deferredZoomToPoint) {
          zoomToPoint(deferredZoomToPoint)
          deferredZoomToPoint = null
        }
      })
      resizeObserver.observe(svgContainerRef.value)

      // console.timeEnd('mount CitaadelMap')
    })

    onUnmounted(() => {
      if (resizeObserver) {
        resizeObserver.disconnect()
        resizeObserver = null
      }
    })

    // console.timeEnd('setup CitaadelMap')
    // console.time('mount CitaadelMap')
    return {
      CITAADEL_WIDTH,
      CITAADEL_HEIGHT,
      parcelFallbackFill,
      paartnerParcels,
      svgContainerRef,
      svgRef,
      zoomCircleRef,
      resetZoom,
      onMouseDownParcel,
      onClickParcel,
      zoomToPoint // public method
    }
  }
}
</script>

